import React from 'react';
import codePrep from '../../assets/images/code'

function Portfolio() {
    return(
        <div class="border p-5">
        <h1 id="portfolio">Projects</h1>
        <div class="projects">
            <div class="single-project">
               <h4> <a href="https://code-prep-project.herokuapp.com/" target="_blank">
                    <img class= "w-60 h-55" src={codePrep} alt="Website example of Code Prep."></img>
                Code Prep</a>
                </h4>
                <p>Node.js, Sequelize, Handlebars</p>
            </div>
        </div>
        </div>
        

    )
}

export default Portfolio;
